ZEND_NAMED_FUNCTION(_wrap_swig_aerospike_alter_newobject) {
  zval args[2];
  swig_object_wrapper *value;

  SWIG_ResetError();
  if(ZEND_NUM_ARGS() != 2 || zend_get_parameters_array_ex(2, args) != SUCCESS) {
    WRONG_PARAM_COUNT;
  }

  value = (swig_object_wrapper *) Z_RES_VAL(args[0]);
  value->newobject = zval_is_true(&args[1]);

  return;
}
ZEND_NAMED_FUNCTION(_wrap_swig_aerospike_get_newobject) {
  zval args[1];
  swig_object_wrapper *value;

  SWIG_ResetError();
  if(ZEND_NUM_ARGS() != 1 || zend_get_parameters_array_ex(1, args) != SUCCESS) {
    WRONG_PARAM_COUNT;
  }

  value = (swig_object_wrapper *) Z_RES_VAL(args[0]);
  RETVAL_LONG(value->newobject);

  return;
}
